import React, { useState } from 'react';
import './index.css';



const App = ()=>{

    const [FullName,setFullName] = useState({
        firstName : '',
        lastName : '',
        email : ''
    });


    const InputEvent = (event)=>{
        console.log(event.target.value);
    }

    
    const FormSubmit = (event)=>{
        event.preventDefault();

    }


    return (

        <>
            <form onSubmit={FormSubmit}>
                <div>
                    <h1>Full Name is : </h1><br/>
                    <input type='text' name='firstName' placeholder='Enter Your First Name' onChange={InputEvent}/><br/>
                    <input type='text' name='lastName' placeholder='Enter Your Last Name' onChange={InputEvent}/><br/>
                    <input type='text' name='email' placeholder='Enter Your Email' onChange={InputEvent} /><br/>
                    <button>Submit</button>
                </div>
            </form>
        </>

    );
}

export default App;
